class Do extends Component {
  render() {
    let styel = {
      color: "red",
      backgroundColor: "black",
      fontSize: "20px",
      border: "2px solid red",
    };
    return (
      <div>
        <p style={styel}>The Doing</p>
        <p>siedoflkvs</p>
      </div>
    );
  }
}

export default Do;
